import "./style.css"
function Nav ({navItems}){
    console.log(navItems)
    return (
        <ul className="navList">
            {
                navItems.map((item, key)=>{
                    return <li key={key} className="navItem">{item}</li>
                })
            }
        </ul>
    )
}

export default Nav;
